from flask import Flask, render_template, request, redirect, url_for
from database import db, Landmark, Cuisine, Event,init_db

app = Flask(__name__)
app.config['SQLALCHEMY_DATABASE_URI'] = 'sqlite:///city_data.db'
app.config['SQLALCHEMY_TRACK_MODIFICATIONS'] = False
init_db(app)



@app.route('/admin_events', methods=['GET', 'POST'])
def admin_events():
    if request.method == 'POST':
        action = request.form.get('action')

        if action == 'create':
            # CREATE
            name = request.form['name']
            date = request.form['date']
            location = request.form['location']
            new_event = Event(name=name, date=date, location=location)
            db.session.add(new_event)
            db.session.commit()

        elif action == 'edit':
            # EDIT
            event_id = request.form['event_id']
            event = Event.query.get_or_404(event_id)
            event.name = request.form['name']
            event.date = request.form['date']
            event.location = request.form['location']
            db.session.commit()

        elif action == 'delete':
            # DELETE
            event_id = request.form['event_id']
            event = Event.query.get_or_404(event_id)
            db.session.delete(event)
            db.session.commit()

        return redirect(url_for('admin_events'))

    # If GET request, just display all events
    events = Event.query.all()
    return render_template('admin_events.html', events=events)


@app.route('/admin_explore', methods=['GET', 'POST'])
def admin_explore():
    if request.method == 'POST':
        category = request.form.get('category')  # either "landmark" or "cuisine"
        action = request.form.get('action')

        if category == "landmark":
            if action == "create":
                name = request.form['name']
                description = request.form['description']
                new_landmark = Landmark(name=name, description=description)
                db.session.add(new_landmark)
                db.session.commit()
            elif action == "edit":
                landmark_id = request.form['id']
                landmark = Landmark.query.get_or_404(landmark_id)
                landmark.name = request.form['name']
                landmark.description = request.form['description']
                db.session.commit()
            elif action == "delete":
                landmark_id = request.form['id']
                landmark = Landmark.query.get_or_404(landmark_id)
                db.session.delete(landmark)
                db.session.commit()

        elif category == "cuisine":
            if action == "create":
                name = request.form['name']
                specialty = request.form['specialty']
                new_cuisine = Cuisine(name=name, specialty=specialty)
                db.session.add(new_cuisine)
                db.session.commit()
            elif action == "edit":
                cuisine_id = request.form['id']
                cuisine = Cuisine.query.get_or_404(cuisine_id)
                cuisine.name = request.form['name']
                cuisine.specialty = request.form['specialty']
                db.session.commit()
            elif action == "delete":
                cuisine_id = request.form['id']
                cuisine = Cuisine.query.get_or_404(cuisine_id)
                db.session.delete(cuisine)
                db.session.commit()

        return redirect(url_for('admin_explore'))

    landmarks = Landmark.query.all()
    cuisines = Cuisine.query.all()
    return render_template('admin_explore.html', landmarks=landmarks, cuisines=cuisines)

@app.route('/')
def index():
    return render_template("index.html")

@app.route('/explore')
def explore():
    
  
 
    landmarks = Landmark.query.all()
    cuisines = Cuisine.query.all()

    # Dictionary to map landmark names to image file paths
    landmark_images = {
        "Bangalore Palace": 'data:image/jpeg;base64,',
        "Lalbagh Botanical Garden":'https://media1.thrillophilia.com/filestore/63znh36mzyxi2gmmbn4c38mekupu_1562854402_lal_bagh.jpg'
        ,
        "Vidhana Soudha":  'data:image/jpeg;base64,',
    }

    cuisine_images = {
        "Masala Dosa":  'data:image/jpeg;base64,',
        "Ghee Pudi Idli": 'data:image/jpeg;base64,',
    }

    # Assign images dynamically if a match is found, otherwise use a default
    for landmark in landmarks:
        landmark.image_url = landmark_images.get(landmark.name, url_for('static', filename='images/default-landmark.jpg'))

    for cuisine in cuisines:
        cuisine.image_url = cuisine_images.get(cuisine.name, url_for('static', filename='images/default-cuisine.jpg'))

 

    return render_template("explore.html", landmarks=landmarks, cuisines=cuisines)

@app.route('/events')
def events():
    events = Event.query.all()
    event_images = {
        "Tech Summit" : "data:image/jpeg;base64,",
        "Holi Day" : 'data:image/jpeg;base64,' ,
        'Bangalore Open Air' : 'data:image/jpeg;base64,'
    }

    # Assign images dynamically if a match is found, otherwise use a default
    for event in events:
        event.image_url = event_images.get(event.name, url_for('static', filename='images/default-event.jpg'))

    return render_template("events.html", events=events)

if __name__ == "__main__":
    app.run(debug=True)

